QR & Barcode Ultima Scanner is the modern QR code and barcode scanner with all the up-to-date features you need!

Scan in one tap of any QR code or barcode to get more insights including results from popular online services like Amazon, eBay, Alibaba, and Google - for 100% FREE!

ALL AVAILABLE COMMON FORMATS:
- Scan all common barcode formats: QR, Data Matrix, Aztec, UPC, EAN, Code 39 and so many more;

INSTANT ACTIONS:
- Open URLs, connect to WiFi hotspots, add calendar events, read VCards, find product and price information of any scanned product you like and so on;

SCAN FROM IMAGES OR FILES:
- Detect codes within picture files or scan directly using the camera.

FLASHLIGHT & ZOOM:
- Activate the flashlight for reliable scans in a dark environment, and use pinch-to-zoom gestures to scan barcodes even from far distances.

CREATE & SHARE:
- Share arbitrary data such as website links, and textual info with the built-in QR code generator by displaying them on your screen as a QR code and scanning them with another device. We have added support for the social media export so that you will be able to share your codes with one action only!

Supported QR codes:
• Texts;
• Social Media links;
• website links (URL);
• contact data (MeCard, vCard, VCF);
• calendar events;
• WiFi hotspot access information;
• Geo locations
• phone call information;
• contact info;
• email, SMS and MATMSG;
• music streaming links;

Barcodes and two-dimensional codes:
• article numbers (EAN, UPC, JAN, GTIN, ISBN)
• Codabar or Codeabar
• Code 39, Code 93, and Code 128
• Interleaved 2 of 5 (ITF)
• PDF417
• GS1 DataBar (RSS-14)
• Aztec Code
• Data Matrix


